import React from 'react';
import '../../../../App.css';

const day = (props) => {
    let imgSrc = props.setImg(props.weather);
    console.log(props.weather);
        return (
            <div className="card dayCard col-lg-4 col-sm-10 align-self-center m-auto" 
                onClick={props.click}>
                <h2>{props.day}</h2>
                <p class="date">{props.date}</p>
                <img src={imgSrc} alt={props.weather} className="dayImg"/>
                <div className="information">
                <p>Maksimalna dnevna temperatura: {props.maxDayTemp} <sup>C</sup></p>
                <p>Minimalna dnevna temperatura: {props.minDayTemp} <sup>C</sup></p>
                <p>Maksimalna nocna temperatura: {props.maxNightTemp} <sup>C</sup></p>
                <p>Maksimalna nocna temperatura: {props.minNightTemp} <sup>C</sup></p>
                <p>Brzina vjetra: {props.windSpeed} km/h</p>
                <p>Vlaznost vazduha: {props.humidity}%</p>
                </div>
            </div>

        );
}

export default day;
